I know this is small and probably can’t even be seen but ever since I have been streaming, I felt like I have grown a lot and my last stream I got my first bit donation. For the past few months I have been struggling with PCOS and being anemic but to have people I know who truly support me and have my back really means a lot. ❤️ A lot of times I feel like giving up or just have a lack of motivation but I always have friends to pick me up and make me say that I am finally proud of who I am.⁣⁣ Streaming and being able to meet such amazing people has truly been a blessing and now I am sponsored and am continuing to grow slowly but surely each day. 💕 Thank you for everybody and for all you do especially those who have always been by my side and supporting me all the way. I love you all 😭🖤
